import React from 'react';

export default function Pantry(props) {
//   const guesses = props.guesses.map((guess, index) => (
//     <li key={index}>
//       {guess}
//     </li>
//   ));

  const ingredients = props.ingredients.map((ingredient, index) => (
    <li key={index} className="ingredients">
      {ingredient}<span className="remove-ingredient">x</span>
    </li>
  ))

  return (
    <div className="my-kitchen menu">
        <ul>
          {ingredients}
        </ul>
    </div>
  );
}
